You can check out the `CreateProject` method.
', 'comment_created': datetime.datetime(2022, 6, 6, 17, 32, 30, tzinfo=datetime.timezone.utc), 'commenter': 'amlannandy', 'type': 'User'}, {'comment_id': 890380987, 'comment_body': 'We're writing a lot of repeated code here for the optional fields. Let's try to minimize it. We can create a util for that. One such approach can be -

1. We can create a list of dictionaries in the helpers file. Each dict would contain info about an optional attribute.

```
issue_attribute_validator = [
    {
        'key': 'priority',
        'enum': allowed_priorities,
    },
    {
        'key': 'entity_id',
    }
]
```

`key` refers to name of the attribute. `enum` can be an optional key in the dict referring to what values does that field allow.

2. And then inside the controller, we can loop over the list and do the check there itself.

```
for attribute in issue_attribute_validator:
    try:
        attribute_value = post_data[attribute['key']]

        # Check if enum is there
        # If yes, validate against it
        if 'enum' in attribute and attribute_value not in attribute['enum']:
            response = {
                'success': False,
                'msg': f'{attribute["key"]} has an invalid value'
            }
            return make_response(jsonify(response)), 400

        # Set attribute in issue object
        setattr(issue, attribute['key'], attribute_value)
    except:
        # If the field is not present then just move on
        continue
```', 'comment_created': datetime.datetime(2022, 6, 6, 17, 39, 40, tzinfo=datetime.timezone.utc), 'commenter': 'amlannandy', 'type': 'User'}, {'comment_id': 890381527, 'comment_body': 'This is just something rough I wrote for your reference. Do let me know if you need my help with this.', 'comment_created': datetime.datetime(2022, 6, 6, 17, 40, 21, tzinfo=datetime.timezone.utc), 'commenter': 'amlannandy', 'type': 'User'}]

